import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './SocialMediaPage.css';

function SocialMediaPage() {
  const navigate = useNavigate();
  const [isConnecting, setIsConnecting] = useState(false);
  const [connectionStatus, setConnectionStatus] = useState('');

  const WEBHOOK_URL = "https://hook.eu2.make.com/m4f3qzhwhe4y62i9ghviwe4zw23hytio";

  const handleFacebookConnect = async () => {
    try {
      setIsConnecting(true);
      setConnectionStatus('Sending data to webhook...');
      console.log("üöÄ Triggering webhook");
      
      // Simple test payload
      const testPayload = {
        platform: "facebook",
        action: "connect",
        message: "Test message from React UI",
        timestamp: new Date().toISOString(),
        testData: true
      };
  
      console.log("üì° Sending to Webhook:", WEBHOOK_URL, testPayload);
  
      const webhookResponse = await fetch(WEBHOOK_URL, {
        method: "POST",
        headers: {
          "Content-Type": "application/json"
        },
        body: JSON.stringify(testPayload)
      });
  
      console.log("‚úÖ Webhook response status:", webhookResponse.status);
      const result = await webhookResponse.text();
      console.log("üì• Webhook response body:", result);
  
      if (webhookResponse.ok) {
        setConnectionStatus('‚úÖ Webhook called successfully!');
      } else {
        setConnectionStatus('‚ùå Webhook call failed');
      }
    } catch (error) {
      console.error('üî• Webhook error:', error);
      setConnectionStatus('‚ùå Webhook error occurred');
    } finally {
      setIsConnecting(false);
    }
  };

  return (
    <div className="page-container">
      <header className="page-header">
        <button onClick={() => navigate('/')} className="back-btn">
          <svg width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
            <polyline points="15,18 9,12 15,6"></polyline>
          </svg>
          Back to Dashboard
        </button>
        <div className="page-title-section">
          <h1 className="page-title">Social Media Automation</h1>
          <p className="page-subtitle">Test webhook connection</p>
        </div>
      </header>

      <main className="page-main">
        <div style={{ 
          display: 'flex', 
          flexDirection: 'column', 
          alignItems: 'center', 
          justifyContent: 'center', 
          minHeight: '400px',
          gap: '20px'
        }}>
          <button 
            onClick={handleFacebookConnect}
            disabled={isConnecting}
            style={{
              background: 'linear-gradient(135deg, #1877F2 0%, #42a5f5 100%)',
              color: 'white',
              border: 'none',
              padding: '15px 30px',
              borderRadius: '10px',
              fontSize: '16px',
              fontWeight: '600',
              cursor: isConnecting ? 'not-allowed' : 'pointer',
              opacity: isConnecting ? 0.7 : 1,
              display: 'flex',
              alignItems: 'center',
              gap: '10px'
            }}
          >
            {isConnecting ? (
              <>
                <div style={{ 
                  width: '16px', 
                  height: '16px', 
                  border: '2px solid white', 
                  borderTop: '2px solid transparent', 
                  borderRadius: '50%', 
                  animation: 'spin 1s linear infinite' 
                }} />
                Connecting...
              </>
            ) : (
              <>
                Connect to Facebook
                <svg width="16" height="16" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                  <path d="M7 17l9.2-9.2M17 17V7H7"/>
                </svg>
              </>
            )}
          </button>
          
          {connectionStatus && (
            <div style={{
              padding: '10px 20px',
              borderRadius: '8px',
              backgroundColor: connectionStatus.includes('‚úÖ') ? '#d4edda' : '#f8d7da',
              color: connectionStatus.includes('‚úÖ') ? '#155724' : '#721c24',
              border: `1px solid ${connectionStatus.includes('‚úÖ') ? '#c3e6cb' : '#f5c6cb'}`,
              fontSize: '14px',
              fontWeight: '500'
            }}>
              {connectionStatus}
            </div>
          )}
        </div>
      </main>
    </div>
  );
}

export default SocialMediaPage;
